import React from "react";
import "./basketCard.scss";
import img from "../../images/img/shoes.png";

const BasketCards = () => {
  return (
    <div className="basket-card-wrap">
      <img className="card-img" src={img} alt="sneakers" />
    </div>
  );
};

export default BasketCards;
